#include <stdio.h>
#include <stdlib.h>
#include <string.h>

#define MAP_SZ 64
#define CTONUM(x) (((x) >= 97) ? (x) - 97 : 32 + (x) - 65)

/************************************/
/* Hash Data Structure              */
/************************************/
struct shash
{
    unsigned long long bmap;
    int nmap[MAP_SZ];
};

/***********************************************************************/
/* gen_hash: Generate hash                                             */
/*                                                                     */
/***********************************************************************/
void gen_hash(char *str, int len, struct shash *sh, struct shash *tsh)
{
    int i;
    unsigned long long t = 1;

    /* Initialize to zeros */
    memset(sh, 0, sizeof(struct shash));

    /* Loop generating the hash */
    for (i = 0; i < len; ++i)
    {
        int o = CTONUM(str[i]);
        sh->nmap[o]++;
        if ((tsh && tsh->nmap[o] && tsh->nmap[o] == sh->nmap[o]) || !tsh)
            sh->bmap |= (t << o);
    }
}

/***********************************************************************/
/* cmp_hash: Compare hash                                              */
/*                                                                     */
/***********************************************************************/
int cmp_hash(struct shash *sh1, struct shash *sh2)
{
    return sh1->bmap == sh2->bmap ? 0 : 1;
}

/***********************************************************************/
/* add_to_hash: Update a hash with new character                       */
/*                                                                     */
/***********************************************************************/
void add_to_hash(char c, struct shash *sh, struct shash *rsh)
{
    int off = CTONUM(c);
    unsigned long long t = 1;

    sh->nmap[off]++; // increment the character count
    /* Update the bitmap only if the character count equals the
       reference hash */
    if (rsh->nmap[off]  && rsh->nmap[off] == sh->nmap[off])
        sh->bmap |= t << off;
}

/***********************************************************************/
/* del_from_hash: Update a hash by removing a character                */
/*                                                                     */
/***********************************************************************/
void del_from_hash(char c, struct shash *sh, struct shash *rsh)
{
    int off = CTONUM(c);
    unsigned long long t = 1;

    sh->nmap[off]--; // decrement the count
    /* Update the bitmap if the reference hash contains more
       more characters */
    if (rsh->nmap[off] > sh->nmap[off])
        sh->bmap &= ~(t << off);
}

/***********************************************************************/
/* Given a string S and a string T, find the minimum window in S which */
/* will contain all the characters in T in complexity O(n).            */
/*                                                                     */
/* For example,                                                        */
/* S = "ADOBECODEBANC"                                                 */
/* T = "ABC"                                                           */
/*                                                                     */
/*                                                                     */
/* Minimum window is "BANC".                                           */
/*                                                                     */
/* Note:                                                               */
/* If there is no such window in S that covers all characters in T,    */
/* return the empty string "".                                         */
/*                                                                     */
/* If there are multiple such windows, you are guaranteed that there   */
/* will always be only one unique minimum window in S.                 */
/***********************************************************************/
char* minWindow(char* s, char* t)
{
    struct shash sh, th;
    int tlen = strlen(t), i = 0, slen = strlen(s), off = slen;
    int min = slen + 1, j = 0;

    /* Validate */
    if (!s || !t || slen < tlen)
        return &s[slen];

    /* Generate target hash  */
    gen_hash(t, tlen, &th, NULL);
    memset(&sh, 0, sizeof(struct shash));

    /* Keep moving the window until all the target characters are
       accounted */
    while (j < slen && cmp_hash(&th, &sh))
        add_to_hash(s[j++], &sh, &th);

    /* Seek for a shorter match */
    while (j < slen)
    {
        /* If the characters match, then save the offset */
        if (!cmp_hash(&th, &sh)) {
            /* If the window is the smallest, then save the offset */
            off = i;
            min = j - i;
        }
        /* Else move the window to the right */
        else
            add_to_hash(s[j++], &sh, &th);
        del_from_hash(s[i++], &sh, &th); // move the left hand side anyway
    }

    /* Finally account for the case where the shortest window is at
    the end of the string. */
    while (!cmp_hash(&th, &sh))
    {
        off = i;
        min = j - i;
        del_from_hash(s[i++], &sh, &th);
    }

    /* Set the NULL termination if we have a non-NULL solution */
    if (off != slen) s[off + min] = 0;
    return &s[off];
}

/***********************************************************************/
/* main: Entry point!                                                  */
/*                                                                     */
/***********************************************************************/
int main()
{
    char s11[] = "cabwefgewcwaefgcf", t11[] = "cae";
    char s10[] = "";
    char t10[] = "";
    char s9[] = "AbabbbAbaA", t9[] = "Bab";
    char s8[] = "bbaa", t8[] = "aba";
    char s7[] = "a", t7[] = "a";
    char s6[] = "";
    char t6[] = "ksrsimxsxxjegkkpj";
    char s4[] = "abc", t4[] = "ac";
    char s5[] = "ab", t5[] = "A";
    char s1[] = "ADOBECODEBANC", t1[] = "ABC";
    char s2[] = "adobecodebanc", t2[] = "abc";
    char s3[] = "a", t3[] = "b";
    char *s[] = {s11, s10, s9, s8, s1, s7, s6, s5, s4, s2, s3}, *t[] = {t11, t10, t9, t8, t1, t7, t6, t5, t4, t2, t3};
    unsigned int i;

    for (i = 0; i < sizeof(s) / sizeof(char *); ++i)
    {
        printf("Min Window for %s %s = ", s[i], t[i]);
        printf("%s :\n", minWindow(s[i], t[i]));
    }
    return 0;
}
